import React from "react";
import DistancSlider from "./DistanceSlider";
import CardGrid from "../cardDetails/CardsGrid";
import faker from "faker";
import Card from "../cardDetails/Cards";
import { render } from "@testing-library/react";

class CardPage extends React.Component {
  constructor(props) {
    console.log("bas ek bar call hona hai tujhe");
    super(props);
  }

  jain = {
    actual: null,
    array: [
      <Card
        imgsrc={faker.image.avatar()}
        distance={20}
        ratings="4"
        link=""
        actual={this.props.dis}

      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={30}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={40}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={50}
        ratings="3"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={60}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={90}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
      <Card
        imgsrc={faker.image.avatar()}
        distance={100}
        ratings="4"
        link=""
        actual={this.props.distance}
      />,
    ],
  };

  checkvalue = () => {
    console.log("vishal");
  };

  render() {
    return (
      <div>
        {this.jain.array.map((items, index) => {
          return (
            this.jain.array[0].props.actual >=
              this.jain.array[index].props.distance
              ? this.jain.array[index]
              : null
          )
        }
        )}


      </div>
    );
  }
}

export default CardPage;
